import {
  Button,
  Card,
  Heading,
  Layout,
  Page 
} from '@shopify/polaris';
import TableCommunes from './components/TableCommunes';
import './css/_app.css';

const communesAdded = [
  {
    id: 23,
    regionId: 1,
    name: 'Las Condes',
    precio: 2000
  }
]

class Index extends React.Component {
  state = { open: false };
  render() {
    return (
      <div className="communeApp">
        <Page
          fullWidth
        >
          <Layout>
            <Layout.Section>
              <Heading element="h1">Comunas sin despacho</Heading>
              <Button primary>Agregar a la lista</Button>

              <Card>
                <TableCommunes></TableCommunes>
              </Card>
            </Layout.Section>
            <Layout.Section>
              <Heading element="h1">Comunas sin despacho</Heading>
            </Layout.Section>
          </Layout>
        </Page>

      </div>
    );
  }
}

export default Index;
